import React, { Component } from "react";
import { Grid, Header } from "semantic-ui-react";

class Profile extends Component {
  render() {
    return (
      <Grid>
        <Grid.Row>
          <Grid.Column>Menu</Grid.Column>
          <Grid.Column>
              <Header>Profile</Header>
                Divider
                
          </Grid.Column>
        </Grid.Row>
      </Grid>
    );
  }
}

export default Profile;
